import React from 'react';

const CustomRadio = () => {
  return (
    <label htmlFor="shows-search">
      shows
      <input
        id="shows-search"
        type="radio"
        value="shows"
        checked={isShowsSearch}
        onChange={onRadioChange}
      />
    </label>
  );
};

export default CustomRadio;
